import React from 'react'
import { Link } from 'react-router-dom'
import { FooterLink2 } from "../../data/footer-links";
import Rlogo from '../../../assets/Logo/RwhiteLogo.png'
import Robinacedamytextlogo from '../../../assets/Logo/robinacedamytextlogo.png'
const Company=["About", "Careers", "Affiliates"]
const Resources = [
  "Articles",
  "Blog",
  "Chart Sheet",
  "Code challenges",
  "Docs",
  "Projects",
  "Videos",
  "Workspaces",
];
const Subjects=FooterLink2[0]
const Plans = ["Paid memberships", "For students", "Business solutions"];
const Community = ["Forums", "Chapters", "Events"];
const Footer = () => {
  return (
    <div className='  w-11/12 max-w-[1200px] mx-auto text-richblack-300 text-[14px] font-inter leading-[22px]'>
        {/* top portion */}
        <div className=' py-12 flex gap-[52px]'>

            {/* left */}
            <div className=' flex gap-[40px]'>

                {/* line 1 vertically */}
                <div>
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' flex flex-col gap-[12px]'>
                            <div className='flex items-center'>
                                <img className=' w-[32px]' src={Rlogo}></img>
                                <img className=' w-[128px]' src={Robinacedamytextlogo}></img>
                            </div>
                            
                            <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Company</div>
                        </div>
                        {/* company sub items */}
                        <div className=' flex flex-col gap-[8px]'>
                            {Company.map((ele,index)=>{
                                return(
                                    <Link to={`/${ele.split(" ").join("-")}`}><div className=' text-[14px] font-inter leading-[22px]'>{ele}</div></Link>
                                )
                            })}
                        </div>
                        
                        
                    </div>
                </div>

                {/* line 2 vertically */}
                <div className=' flex flex-col gap-[30px]'>
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' flex flex-col gap-[12px]'>
                            <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Resources</div>
                        </div>
                        {/* Resources sub items */}
                        <div className=' flex flex-col gap-[8px]'>
                            {Resources.map((ele,index)=>{
                                return(
                                    <Link to={`/${ele.split(" ").join("-")}`}><div className=' text-[14px] font-inter leading-[22px]'>{ele}</div></Link>
                                )
                            })}
                        </div>
                        
                        
                    </div>
                    {/* support */}
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Support</div>
                        <Link to={`/Help-Center`}><div className=' text-[14px] font-inter leading-[22px]'>Help Center</div></Link>
                    </div>
                    
                </div>
                
                {/* line 3 vertically */}
                <div className=' flex flex-col gap-[30px]'>
                    {/* plans */}
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' flex flex-col gap-[12px]'>
                            <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Plans</div>
                        </div>
                        {/* Plans sub items */}
                        <div className=' flex flex-col gap-[8px]'>
                            {Plans.map((ele,index)=>{
                                return(
                                    <Link to={`/${ele.split(" ").join("-")}`}><div className=' text-[14px] font-inter leading-[22px]'>{ele}</div></Link>
                                )
                            })}
                        </div>
                        
                        
                    </div>
                    {/* Community */}
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' flex flex-col gap-[12px]'>
                            <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Community</div>
                        </div>
                        {/* Plans sub items */}
                        <div className=' flex flex-col gap-[8px]'>
                            {Community.map((ele,index)=>{
                                return(
                                    <Link to={`/${ele.split(" ").join("-")}`}><div className=' text-[14px] font-inter leading-[22px]'>{ele}</div></Link>
                                )
                            })}
                        </div>
                        
                        
                    </div>
                </div>

            </div>

            {/* horizontal line */}
            <div className=' bg-[#2C333F] w-[1px] min-h-full'></div>

            {/* right */}
            <div className=' flex gap-[40px]'>

                {/* line 1 vertically */}
                <div className=' flex flex-col gap-[30px]'>
                    {/* plans */}
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' flex flex-col gap-[12px]'>
                            <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Subjects</div>
                        </div>
                        {/* Subjects sub items */}
                        <div className=' flex flex-col gap-[8px]'>
                            {Subjects.map((ele,index)=>{
                                return(
                                    <Link to={`/${ele.split(" ").join("-")}`}><div className=' text-[14px] font-inter leading-[22px]'>{ele}</div></Link>
                                )
                            })}
                        </div>
                        
                        
                    </div>
                    {/* Community */}
                    <div className=' flex flex-col gap-[12px]'>
                        <div className=' flex flex-col gap-[12px]'>
                            <div className=' text-[16px] font-inter font-semibold leading-[24px]'>Community</div>
                        </div>
                        {/* Plans sub items */}
                        <div className=' flex flex-col gap-[8px]'>
                            {Community.map((ele,index)=>{
                                return(
                                    <Link to={`/${ele.split(" ").join("-")}`}><div className=' text-[14px] font-inter leading-[22px]'>{ele}</div></Link>
                                )
                            })}
                        </div>
                        
                        
                    </div>
                </div>
            </div>
        </div>
        {/* horizontal line */}
        <div className=' h-[1px] w-full bg-[#2C333F]'></div>
        {/* bottom-part */}
        <div className=' flex justify-between py-9'>
            {/* left part */}
                <div className='flex'>
                    <Link to={"/privacyPolicy"}><div className=' border-r border-[#2C333F] pr-4'>Privacy Policy</div></Link>
                    <Link to={"/cookiePolicy"}><div className=' border-r border-[#2C333F] px-4'>Cookie Policy</div></Link>
                    <Link to={"/terms"}><div className=' pl-4'>Terms</div></Link>
                </div>
            {/* right part */}
                <div>
                Made with <span className=' text-[#EF476F]'>♥</span> CodeHelp © 2023 RobinAcedamy
                </div>
        </div>
    </div>
  )
}

export default Footer
